from Crypto.Cipher import Blowfish
from binascii import unhexlify

# --- Input: hex strings ---
hex_key = "11cb6c93ed317ce53ad64c03b7b613db"  
hex_ciphertext = ""  # Replace with your ciphertext

key = unhexlify(hex_key)
ciphertext = unhexlify(hex_ciphertext)
cipher = Blowfish.new(key, Blowfish.MODE_ECB)
decrypted = cipher.decrypt(ciphertext)

def unpad(s):
    pad_len = s[-1]
    if all(p == pad_len for p in s[-pad_len:]):
        return s[:-pad_len]
    return s  # Padding not present or invalid

plaintext = unpad(decrypted)

# --- Output ---
#print("Decrypted (raw bytes):", plaintext)
#print("Decrypted (utf-8):", plaintext.decode('utf-8', errors='replace'))

with open('decrypted_output.raw', 'wb') as f:
    f.write(plaintext)
